// Imports

import React, { useEffect, useState } from 'react';
import { useRouteMatch, Link } from 'react-router-dom';
import { FiChevronLeft, FiChevronRight } from 'react-icons/fi';
import api from '../../services/api';

import { Header, RepositoryInfo, Issues } from './styles';
import logoImage from '../../assets/logo.svg';

// Interfaces

interface RepositoryParams {
  repository: string;
}

interface Repository {
  full_name: string;
  description: string;
  stargazers_count: number;
  forks_count: number;
  open_issues_count: number;
  owner: {
    login: string;
    avatar_url: string;
  };
}

// Aplication

const Repository: React.FC = () => {
  const [repository, setRepository] = useState<Repository | null>(null);
  const [issues, setIssues] = useState([]);

  const { params } = useRouteMatch<RepositoryParams>();

  useEffect(() => {
    api.get(`repos/${params.repository}`).then((response) => {
      console.log(response.data);
    });

    api.get(`repos/${params.repository}/issues`).then((response) => {
      console.log(response.data);
    });
  }, [params.repository]);

  return (
    <>
      <Header>
        <img src={logoImage} alt="Logo GitHub Explorer" />
        <Link to="/">
          <FiChevronLeft size={16} />
          Voltar
        </Link>
      </Header>

      <RepositoryInfo>
        <header>
          <img src="https://scontent.fssz4-1.fna.fbcdn.net/v/t1.0-9/81372042_2623632174372422_3540091806924406784_n.jpg?_nc_cat=106&_nc_sid=09cbfe&_nc_ohc=T0oUqGA3yOUAX8BaKUk&_nc_ht=scontent.fssz4-1.fna&oh=edaf3b8118363e068a977b6ac4f8107f&oe=5EC68F10" />

          <div>
            <strong>TESTE TESTE TESTE</strong>
            <p> TESTE TESTE TESTE</p>
          </div>
        </header>
        <ul>
          <li>
            <strong>1984</strong>
            <span> Stars</span>
          </li>
          <li>
            <strong>48</strong>
            <span> forks</span>
          </li>
          <li>
            <strong>67</strong>
            <span> Issues Abertas</span>
          </li>
        </ul>
      </RepositoryInfo>

      <Issues>
        <Link to="AUEHAUEHAU">
          <div>
            <strong> UAHEAUEHA </strong>
            <p> AHEUAEHA</p>
          </div>

          <FiChevronRight size={20} />
        </Link>
      </Issues>
    </>
  );
};

export default Repository;
